    //style
    const style= {
        
        color:'blue',
        fontSize:'18px',
    }

    function inc(){
        alert("ouch")
        setCount(oldValue => oldValue+ Number(delta))
    }
    function delta_inc(e){
        //new input value = e.target.value
        setDelta(Number(e.target.value))
    }

